import React from "react";

const SellBetter = () => {
  return (
    <>
      <div className="min-h-screen bg-black text-white flex flex-col items-center justify-center px-6">
        <div class="flex flex-col items-center justify-center text-center space-y-4">
          <p class="text-white text-[90px] font-medium leading-[103.125%] tracking-tight sm:text-[70px] md:text-[80px] lg:text-[90px]">
            Sell
          </p>

          <p class="text-transparent bg-clip-text bg-gradient-to-r from-pink-500 via-pink-300 to-purple-500 text-[90px] font-medium leading-[103.125%] tracking-tight sm:text-[70px] md:text-[80px] lg:text-[90px]">
            Better
          </p>
        </div>
      </div>
    </>
  );
};

export default SellBetter;
